import React, { useEffect, useState } from "react";

const MemberList = props => {
  return (
    <div>
      {props.team.map(mem => {
        return (
          <div>
            <p>{mem.name}</p>
            <p>{mem.role}</p>
            <p>{mem.email}</p>
          </div>
        );
      })}
    </div>
  );
};

export default MemberList;
